    "short_description": "Protect your investment and you peace of mind with the MRCOOL Mini-Split Cleaning Kit",
    "long_description": "Experience peace of mind and protect your investment of your 4th Generation MRCOOL® DIY® Mini-Split system with the MRCOOL® Care Kit. When you register your unit online at mrcool.com/warranty-registration, you will sign up for a sustained subscription to this innovative kit that will auto-ship to your home every six months. It will allow you to clean, disinfect, and protect your units, thus lengthening their lifespans by allowing the equipment to run at its most optimal operation. By subscribing, you will be entitled to the best warranty in the industry: a limited lifetime compressor warranty, a 5 year parts warranty, and a 7 year unit replacement warranty. The kit includes foaming cleaner, pull-rod spray gun, water bottle, water collection bag, drain hose, and a new air-freshening filter to replace the current one. Also included are easy to understand instructions. It is as simple as spraying the cleaner on the coils, and allowing it to soak before rinsing it off. No hands-on scrubbing necessary. Rest assured if you need more assistance using the care kit, our customer support team can easily help. When you maintain your system with the care kit every six months, you’ll be able to rest easy knowing your system is protected from unexpected repair costs.",
