    "short_description": "36K BTU Hyper Heat Central Ducted Heat Pump Condenser",
    "long_description": "The 36K BTU MRCOOL® Hyper Heat Central Ducted Heat Pump Condenser offers a dependable solution for coping with the harshest winters and summers. Utilizing a DC Inverter and cutting-edge variable speed technology, the unit delivers remarkable efficiency, leading to significant utility cost savings without compromising performance. Boasting an impressive SEER2 rating of up to 16 and an HSPF2-4 rating of up to 9.5, its superior heating capacity ensures indoor comfort even when outdoor temperatures plummet to -22°F or soar to 122°F. Installation is effortless for professional HVAC technicians utilizing the compatible MRCOOL® No-Vac® Quick Connect® Line Set. This distinctive line set eliminates the need for vacuuming or flare welding and is kink-resistant, expediting the connection process and lowering installation costs. Furthermore, the unit employs the environmentally friendly R-410A refrigerant, ensuring no harm to the environment. Constructed with top-quality materials like painted galvanized steel, the unit is built to last and withstand damage from extreme weather, animals, or yard equipment. In the unlikely event of any issues, a 10-year warranty covering the compressor, parts, and labor supports the unit. As an added bonus, the labor warranty is automatically activated upon installation, removing the need for a time-consuming registration process.",
