    "short_description": "24K BTU Hyper Heat Central Ducted Heat Pump Condenser",
    "long_description": "The MRCOOL® 24K BTU Hyper Heat Central Ducted Heat Pump Condenser is a dependable choice for handling extreme winter and summer temperatures. Boasting a DC Inverter and state-of-the-art variable speed technology, this unit offers exceptional efficiency, leading to significant savings on utility expenses without compromising performance. With an impressive SEER2 rating of up to 17.4 and an HSPF2-4 rating of up to 10, its enhanced heating capacity ensures indoor comfort even when outdoor temperatures range from -22°F to 122°F. Installation is simple for professional HVAC technicians using the MRCOOL® No-Vac® Quick Connect® Line Set. This exclusive line set eliminates the need for vacuuming or flare welding and is kink-resistant, accelerating the connection process and reducing installation costs. Moreover, the eco-friendly R-410A refrigerant ensures no environmental harm. Constructed from high-quality materials like painted galvanized steel, this durable unit can withstand damage from severe weather, animals, or yard equipment, guaranteeing reliable performance for years. In the unlikely event of any issues, the unit is supported by a 10-year warranty covering the compressor, parts, and labor. Additionally, the labor warranty is automatically activated upon installation, eliminating the need for a time-consuming registration process.",
