    "long_description": "Introducing a cost-effective yet potent heating and cooling option: the 60K BTU MRCOOL® Hyper Heat Central Ducted Heat Pump Condenser, designed to reliably create a comfortable environment without straining your budget. Equipped with a DC Inverter and advanced variable speed technology, the unit achieves exceptional efficiency, resulting in significant utility cost reductions without compromising performance. It boasts an impressive SEER2 rating of up to 15.3 and an HSPF2-4 rating of up to 9.4, thanks to its superior heating capacity, maintaining indoor comfort even when outdoor temperatures fall to -22°F or soar to 122°F. For professional HVAC technicians, installation is simple using the compatible MRCOOL® No-Vac® Quick Connect® Line Set. This innovative line set eliminates the need for vacuuming or flare welding and is kink-resistant, accelerating the connection process and reducing installation costs. Additionally, the unit employs the eco-friendly R-410A refrigerant, ensuring no environmental harm. Constructed with high-quality materials like painted galvanized steel, this durable unit withstands damage from extreme weather, animals, or yard equipment, ensuring reliable performance for years to come. In the unlikely event of any issues, the unit is supported by a 10-year warranty covering the compressor, parts, and labor. Moreover, the labor warranty is automatically activated upon installation, eliminating the need for a time-consuming registration process.",
