    "short_description": "24K MRCOOL® Hyper Heat Central Ducted Air Handler",
    "long_description": "The 24K MRCOOL® Hyper Heat Central Ducted Air Handler is an affordable and efficient choice for your home's heating and cooling requirements, regardless of external weather conditions. With an impressive SEER2 rating of up to 17.4 and an HSPF2-4 rating of up to 10, its enhanced heating capacity ensures optimal performance. Constructed from painted galvanized steel, the unit's side-discharge design, slide-out blower, self-diagnostics panel, and removable filters make maintenance simple and easy. Effortless installation is possible by an HVAC technician, as the unit is compatible with the optional MRCOOL® No-Vac® Quick Connect® Line Set. Pre-charged with environmentally friendly R410-A refrigerant, this line set removes the need for vacuuming or flare welding and is kink-resistant. It also provides versatile installation possibilities due to its adaptability to various configurations. If required, an optional heat kit can be acquired separately. The unit also includes a wired thermostat and wireless remote. In the unlikely event of any operational concerns, the air handler is backed by a reassuring 10-year warranty for parts and labor, offering you peace of mind. Furthermore, registration is not required for the included labor warranty.",
