    "short_description": "48K MRCOOL® Hyper Heat Central Ducted Air Handler",
    "long_description": "Regardless of external weather conditions, the 48K MRCOOL® Hyper Heat Central Ducted Air Handler is an exceptional choice for your home's heating and cooling needs. Its efficiency results in utility expense savings, and it boasts an impressive SEER2 rating of up to 15.6 and an HSPF2-4 rating of up to 9.4 due to its superior heating capacity. Constructed with painted galvanized steel, the high quality unit features a side-discharge design, slide-out blower, self-diagnostics panel, and removable filters for easy maintenance. An HVAC technician can effortlessly install the unit, which is designed to work with the optional MRCOOL® No-Vac® Quick Connect® Line Set. This line set comes pre-charged with eco-friendly R410-A refrigerant, eliminating the need for vacuuming or flare welding and providing kink resistance. It allows for flexible installation options as it can be configured in various ways. Additionally, a wired thermostat, wireless remote, and an optional heat kit are available if needed. Should any operational concerns arise, the air handler is backed by a reassuring 10-year warranty for parts and labor, giving you peace of mind. Moreover, there's no need to register for the included labor warranty.",
