    "long_description": "Introducing the Cool Blade HVLS 24 FT Fan. The patented Tubercle Blades design uses whale power technology to produce greater air volume than other industrial fans with similar diameter.\nOur Tubercle Blades create a max angle reaching up to 21 to and reduce wingtip stall. By countering wingtip stall, the Tubercle Blades reduce the main source of noise and vibration. The advanced safety protection features ensure safe and stable construction and operation. The Cool Blade is inexpensive to operate and improves the performance of both new and old heating and cooling systems. On top of that the motor design reduces the need for regular maintenance saving you time and labor.",
    "works_with": "",
    "feature_list": "<ul><li>Tubercle Airflow Technology. Our Patented Blades Blow More. Our patented Cool Blade TubercleTM Airflow Technology, supresses outside heat &amp; humidity through high volume air circulation, reducing temperatures by 10 degrees on average.</li><li>German Engineered Performace. UL &amp; CE Certified NORD Motor. Our NORD DC motor is designed for silent efficient operation, working with our patented blades to generate a steady natural open-air breeze, surpassing conventional fans in climate control.</li><li>As Big as It Gets.As Big as You Need. Available in 3 sizes: 14Ft, 18Ft, &amp; 24Ft. One 24 foot fan can cover over 24,750 square feet!</li><li>&quot;Magic Box&quot; Controller. Durable, Easy, Made in the USA. The USA-made Honeywell Controller is not only durable and easy to use, it is also a phase converter, allowing standard 220 volt installation for the powerful and efficient 3 phase motor.</li><li>Superior Safety. Protecting You and Your Investment. Cool BladeTM systems are engineered with electrical overload protection, reinforced fasteners, safety clips and connectors, steel wire safety cable and more.</li><li>Low Maintenance. Take it for granted. Cool BladeTM systems are engineered to reduce the need for regular maintenance. Inspection is recommended only every 20,000 hours of run time!</li><li>Efficient. Low Cost &amp; Low Impact. The unit is inexpensive to operate and improves the performance of both new and old heating and cooling systems. Only 1.5kw power consumption.</li><li>Blade Pack: 10.63in X 14.96in 331 lbs</li><li>Motor Pack: 33.62in X 32.44in 353 lbs</li></ul>",
