    "short_description": "MrCool DIY 4th Gen Single-Zone 24k Condenser 230V",
    "long_description": "The MRCOOL® 4th Generation DIY 24K BTU, 20.5 SEER Ductless Heat Pump is an all in one system that seamlessly combines efficiency, durability, and simplicity. This system can offer a 20.5 SEER efficiency rating that has allowed it to achieve an Energy Star certification and can heat & cool an area up to 1,000 sq. ft. It also features durable construction and a corrosion-resistant Gold Fin condenser. All of this is contained within a Do-It-Yourself system that can be installed by a homeowner in a few hours using simple tools. This simplicity is achieved with the use of the patented MrCool Pre-Charged Quick-Connect Line Set included with the system. Not only is this system capable of delivering exceptional performance, it is also equipped with up to six operating modes, which include AUTO, HEAT, COOL, FAN-ONLY, DRY (dehumidification), and SLEEP. The system’s Follow Me Feature allows the system to adjust the room temperature based on wherever you’re standing with the hand-held remote control. This system also has the ability to be controlled with a smartphone by way of the Smart HVAC app. Backed by a limited lifetime compressor warranty, this system is sure to meet your comfort needs and peace of mind.",
