    "long_description": "The MRCOOL® 4th Generation DIY 18K BTU, 22 SEER Ductless Heat Pump system offers a complete solution to your home’s heating and cooling needs. This system can heat & cool an area up to 750 sq. ft and is capable of an Energy Star certified, 22 SEER efficiency rating. However, the best feature of this system is the ease of installation it provides to the homeowner. With the included pre-charged 25 ft. line set, some hand tools, and a few hours of time this entire system can be completely installed. This system comes equipped with many functions that separate it from the rest. It has multiple operating modes, which include AUTO, HEAT, COOL, FAN-ONLY, DRY (dehumidification) and SLEEP. It also features the Follow Me function, which allows the system to continually adjust the room temperature based on where the hand-held remote controller is. Need to operate the system when you’re not at home? No problem. The MrCool system also has the capability of being operated with your smartphone with the use of the Smart HVAC app. MrCool stands behind the quality and workmanship of this system by being the only manufacturer to offer a limited lifetime compressor warranty.",
