    "short_description": "MRCOOL® DIY 4th Gen 36k BTU Ductless Mini-Split Heat Pump Complete System - 208-230V/60Hz",
    "long_description": "The MRCOOL® 4th Generation DIY 36K BTU, 18 SEER Ductless Heat Pump is one of the most powerful single-zone systems offered in the DIY Series. This complete system has the heating and cooling performance to cover an area up to 1500 sq. ft while still being able to achieve an 18 SEER efficiency rating. All of this performance is within a system that can be easily installed by a homeowner with a few hand tools thanks to the patented MrCool Pre-Charged Quick-Connect Line Set that makes connecting refrigerant piping as simple as turning a few wrenches. The benefits of this system are not limited to the performance and ease of installation. This system also has many operational functions and features that sets it apart. The user can select from up to six operation modes AUTO, HEAT, COOL, FAN-ONLY, DRY (dehumidification), and SLEEP. This system features a Follow Me function which can constantly adjust the temperature of the room by sensing the temperature from the location of the handheld remote controller. This system can also be operated with an Apple or Android smartphone by downloading the Smart HVAC app. MrCool offers a limited lifetime compressor warranty on this system.",
