    "long_description": "The 4th Generation MRCOOL® DIY 36K BTU 4-Zone Ductless Heat Pump offers the latest in heat pump innovations.This condenser has the ability to support up to 4 zones and, when paired with select MrCool air handlers, can provide a SEER efficiency rating of up to 21.5. It even has the ability to provide heat when temperatures drop to -13°F. It features a Gold Fin Condenser coating which allows it to withstand the elements and resist corrosion. MrCool stands behind the quality & durability of this condenser by being the only manufacturer to offer a limited lifetime compressor warranty. However, the most innovative feature is that it can be installed by the homeowner without the use of a certified technician. This is possible because the condenser is intended to be used with MrCool’s patented Pre-Charged Quick Connect Line Sets. These line sets are precharged with R-410A refrigerant and feature quick connect connectors which allow it to be connected using only wrenches. Because it is pre-charged, the system will not require vacuuming once the installation is complete. The 4th Generation MrCool DIY 36K BTU 4-Zone Ductless Heat Pump is one of the best options on the market when it comes to multi-zone comfort.",
