    "short_description": "MRCOOL® E Star DIY 4th Gen 12k BTU Ductless Mini-Split Air Handler 208-230V/60Hz",
    "long_description": "The MRCOOL® 4th Generation DIY 12K BTU Ductless Wall Mounted Air Handler is an essential component of a MRCOOL® DIY system. When paired with a MrCool Condenser, it is capable of achieving a 22 SEER efficiency rating and has the ability to heat and cool an area of up to 500 sq ft. It features multiple modes of operation such as COOL, HEAT, AUTO, DRY (dehumidify), and SLEEP so it is sure to suit your needs. It can also be conveniently operated from anywhere using your Apple or Android smartphone with the Smart HVAC app. This air handler can be easily mounted with the included and easy-to-use wall mounting plate. It is also very compact, especially when compared to the components of a traditional ducted system, so it can be easily maneuvered into place. It was also designed to be used with MrCool’s patented Pre-Charged Quick Connect Line Set. So, installing the refrigerant piping is as simple as turning a few wrenches. Since the line set comes pre-charged with the precise amount of R-410A refrigerant, no vacuuming or charging is required once connected. Select the MrCool 4th Generation DIY 12K BTU Ductless Wall Mounted Air Handler to be your home comfort solution.",
