    "long_description": "The MRCOOL® 4th Generation DIY 18K BTU Ductless Wall Mounted Air Handler is one of the most capable on the market. When part of a MRCOOL® DIY system, it can reach an effective 22 SEER efficiency rating and deliver that performance to an area up to 750 sq. ft. This air handler is also very versatile because of its many different operating modes, these include, COOL, HEAT, AUTO, DRY (dehumidify), and SLEEP. It also has the ability to be controlled from anywhere using an Apple or Android smartphone with our convenient Smart HVAC app. This air handler is very compact and relatively light, so it can easily be mounted to most interior walls using the included mounting plate. The ease of installation does not stop there, as it is designed to be used along with the MrCool Pre-Charged Quick Connect Line Set. This allows the installer to easily connect the refrigerant piping, which is precharged with the correct amount of R-410A refrigerant, with the use of simple hand tools. This also means the system will not require any vacuuming once the line set is connected. The MrCool DIY 18K BTU Ductless Wall Mounted Air Handler has the performance to handle your home comfort needs.",
