    "long_description": "The MRCOOL® 4th Generation DIY 24K BTU Ductless Wall Mounted Air Handler offers the performance you need to compliment your MRCOOL® DIY system. When connected to a MRCOOL® condenser, this air handler has the ability to reach a 20.5 SEER efficiency rating. It also has the power to deliver air to an area of up to 1,000 sq. ft. To make sure it can handle your needs, it is also equipped with multiple operating modes which include COOL, HEAT, AUTO, DRY (dehumidify), and SLEEP. With the use of the Smart HVAC app, it also has the ability to be operated from your Apple or Android smartphone. With its compact design and easy to use mounting plate, this air handler can be mounted to most interior walls. It is also meant to be used with the MrCool Pre-Charged Quick Connect Line Set to further the ease of installation. This line set is equipped with MrCool’s patented quick connectors, so it can be connected with use of only simple hand tools. It also precharged from the factory with the correct amount of R-410A refrigerant and requires no vacuuming once connected. The MrCool 4th Generation DIY 24 BTU Ductless Wall Mounted Air Handler is equipped with the power and performance to satisfy air conditioning needs of your home.",
    "works_with": "",
    "feature_list": "<ul><li>SmartHVAC app: WIFI control - control your DIY anywhere with your Apple or Android smart device and an Internet connection</li><li>Standard 7-year compressor/5-year parts warranty; register for limited lifetime compressor warranty</li><li>Compatible with Amazon Alexa and Google Assistant</li><li>Includes the new DIY Pro™ Cable, an added safety feature to protect the wiring from the outside elements</li></ul>",
