    "short_description": "The MRCOOL® DIY® Series OuttaSight™ 18k BTU Ceiling Cassette provides efficient heating and cooling while remaining out of sight and discreet, making it a perfect fit for any space.",
    "long_description": "The MRCOOL® DIY® Series OuttaSight™ 18k BTU Ceiling Cassette provides efficient heating and cooling while remaining out of sight and discreet, making it a perfect fit for any space. This easy to install and easy to maintain unit is offered in both single-zone and multi-zone options and can provide coverage for large and small spaces. The OuttaSight™ cassette features an easy, low profile installation and can be recessed between all types of joists on 16 inch center including pre-manufactured I-joists. This makes it a perfect option for both new construction or retrofits. It doesn’t have strict installation requirements like other ceiling cassettes, so you’re able to install it in the location that suits you best, without using ductwork or wall space. The OuttaSight™ works with the MrCool® DIY® Quick Connect® line set and the No-Vac® Coupler to increase the length of the line set. Not only does the unit offer quiet operation and multiple operating modes, but it also features the Elevation function that lowers the filter panel for easy air filter maintenance. Purchases of the MrCool® DIY® Series OuttaSight™ 18k BTU Ceiling Cassette are protected by a limited lifetime warranty in addition to a 7-year compressor warranty and 5-year parts warranty.",
    "works_with": "DIY 4th gen MZ",
