    "country_of_origin": "",
    "short_description": "The MRCOOL® DIY® Series OuttaSight™ 9k BTU Ceiling Cassette is perfect for any space and provide discreet and out of sight heating and cooling.",
    "long_description": "The MRCOOL® DIY® Series OuttaSight™ 9k BTU Ceiling Cassette is perfect for any space and provide discreet and out of sight heating and cooling. It is available in multi-zone options and is easy to install, fitting between 16” ceiling joists. The OuttaSight™ cassette is designed to work with both current and future joist standards and can be recessed between all types of joists on 16 inch center, including pre-manufactured I-joists. Other ceiling cassettes have strict installation requirements in less ideal locations, but the MrCool® OuttaSight™ doesn't require ductwork or wall space and is perfect for new constructions or retrofits. The cassette works with the MrCool® DIY® Quick Connect® line set which makes installation even easier since it is precharged with refrigerant, eliminating the need for vacuuming. The No-Vac® Coupler can be used to increase length. With advanced filtration, each cassette offers an Elevation function that lowers the filter panel for easy filter maintenance. Not only does this cassette feature quiet operation and multiple operating modes, but also provided is a limited lifetime warranty in addition to a 7-year compressor warranty and 5-year parts warranty, so you can feel confident in your investment.",
    "works_with": "DIY 4th gen MZ",
    "feature_list": "<ul><li>Fits between 16&quot; Ceiling Joists</li><li>Featuring our easy access, elevating filter that can be lowered to a maximum of 4.9ft from the cassette.</li><li>Low Profile Installation</li><li>Pair with your DIY 4th gen Multi-Zone system</li><li>Designed to work with current and future joist standards, it can be recessed between all types of joists on 16 inch center - including pre-manufactured I-joists.</li></ul>",
