    "short_description": "MRCOOL® DIY Easy Pro® 12k BTU Ductless Mini-Split Heat Pump Condenser",
    "long_description": "Skip professional installation with the MRCOOL® Easy Pro® 12k BTU Ductless Mini-Split Heat Pump System. This system can heat or cool a room of up to 500 square feet and features an 18 SEER efficiency rating. It’s easily installed without any special tools, training, or professional assistance thanks to the Fast Connection® fittings on the 16 foot pre-charged line set. There are a plethora of features to enjoy such as the Follow Me® feature that keeps you comfortable no matter where you are in the room, and convenient operational modes such as the Sleep Mode, Timer Mode, and Auto Mode. The filters are easily cleaned with water, and the indoor and outdoor units are cleaned with a simple dry or damp cloth. You can control the unit with your Apple or Android device via the SmartHVAC app, the included remote, or your Amazon Alexa or Google Assistant devices. This system includes a 1-year compressor warranty and 2-year parts warranty in the unlikely case something goes wrong. This is an excellent choice to save money while receiving excellent heating and cooling in your home.",
    "works_with": "",
    "feature_list": "<ul><li>Up to 18 SEER</li><li>Gold Fin® condenser: corrosion resistant - live on the coast? Don&#39;t worry, our condenser is built to resist long term corrosion</li><li>Energy Efficient DC Inverter</li><li>Low ambient cooling: cooling down to 5F exterior temperatures, the ideal system for computer server rooms, greenhouses, and any other applications that require cooling all year</li><li>Includes features such as timer mode, refrigerant leakage detection, and more</li><li>Systems include our SmartHVAC WiFi Control Module with improved setup and enhanced functionality for Apple and Android smart devices. Works with Amazon Alexa. Works with Google Assistant.</li><li>Quiet Running</li></ul>",
