    "short_description": "GeoCool 48K-60K BTU Multi Positional Air Return",
    "long_description": "You can count on the MRCOOL® Geocool® Geothermal Split System optional Return Air Box module to contribute to the system’s impressive performance and energy efficiency. With up to 70 EER, the geothermal system will lower utility costs without sacrificing effectiveness. The Return Air Box defaults to a right hand return, but is conveniently dual-sided to utilize a left hand return as well, aiding in the system’s exceptionally flexible installation options. With vertical, horizontal, split, and integral configurations, the complete geothermal system is perfect for hard to fit spaces and alternative air outlet methods. The durable build and finish ensure the unit’s reliability to provide your ultimate comfort for years to come. Maintenance is a breeze thanks to the return air box’s easy filter access, and you can enjoy peace of mind thanks to the 5-year limited labor warranty and 10-year parts warranty.",
