    "short_description": "GeoCool 60K BTU 5T Split Blower Multi Positional 1400 CFM",
    "long_description": "The MRCOOL® Geocool® Geothermal Split System Blower module is part of the exceptionally efficient geothermal heating and cooling system. When combined with the other powerfully performing Geocool® modules, you’ll experience impressive comfort with an EER up to 70. The blower aids in the system’s flexible installation options for areas with spacial constraints, including vertical, horizontal, and split configurations, making it possible to adapt to differing air outlet methods and situations. Not to mention, its durable build and finish aid in the unit’s reliability to last for years to come. Not only is installation easy with a drastic reduction in utility costs, the blower offers more comfort with lower noise emittance. With a cooling noise as low as 58dBA and heating as low as 60dBA, you’ll experience your most comfortable environment without any loud interruptions. You can rest easy knowing the MRCOOL® Geocool® Geothermal Split System Blower module is protected by a 5 year limited labor warranty and a 10 year parts warranty.",
