    "long_description": "Prepare to enjoy impressive performance and exceptional energy efficiency with the MRCOOL® Geocool® Geothermal Split System Compressor. With an all DC inverter system and a high precision electronic expansion valve, you can expect a much quieter, stable, and energy-saving experience with more accurate temperature control than with standard heating and cooling systems. The open loop water-to-air system’s superb energy efficiency boasts up to 70 EER, significantly lowering utility costs. Installation is easy with the compatible MRCOOL® Geocool® No-Vac® Line Set. The system features multiple flexible installation options including vertical, horizontal, and split configurations. This makes this system an excellent solution if your home has space constraints or requires modification to a different air outlet method. The compressor features multiple protections against potential damage along with a reliable and durable build and finish. The co-axial copper-nickel heat exchanger makes the system suitable for salt solution and lower water quality, and improves corrosion resistance and unit reliability. With a cooling noise level as low as 58dBA and heating noise level as low as 60dBa, you’re able to enjoy superior comfort without any distraction. For peace of mind, this MRCOOL® Geocool® Geothermal Split System Compressor offers a 10-year parts warranty as well as a 5-year limited labor warranty.",
