    "long_description": "There isn’t much you can do with an air conditioning system that’s boosting your bills and the temperature of your home besides replace it, and for that, you should choose the ProDirect 2.5 Ton 14 SEER Split System A/C Condenser. The rotary compressor within this system allows it to be faster and more efficient than other systems. The piston flow control device further improves efficiency, as well, making for a system that will drop both your bills and your home’s temperature lower than you can remember. This condenser will be one of the toughest units you’ve ever had in your home. You’ll love how sturdy the galvanized steel cabinet is, and how the Gold Fin® coating repels water and stops corrosion and rust in its tracks. There’s barely any risk of your system getting damaged thanks to the protection of the non-toxic, environmentally friendly Gold Fin® coating. This unit, which is ETL listed and AHRI rated, has serious warranty protection when registered. Never suffer through another sweaty summer again with the cooling power of this MRCOOL ProDirect 2.5 Ton split system A/C condenser.",
