    "long_description": "Treat yourself to the comfort you’ve always dreamed of, especially if you’ve had to endure summer after summer of sweaty discomfort, with the ProDirect 3 Ton 15 SEER Split System A/C Condenser. The rotary compressor within this system can process refrigerant extremely quickly to get your home feeling the precise temperature you prefer. The piston flow control device can bump your system’s efficiency levels up significantly, too. The safety of your system is a priority, because if something happens to it, you’ve lost your source of comfort! That’s why you can rely on the galvanized steel cabinet and the Gold Fin® coil coating to keep your unit running as if it’s brand new! This environmentally-friendly and non-toxic coating can keep water from sticking to the coils of your unit so rust can’t form. This AHRI certified and ETL listed unit is further protected by a reliable warranty once you register it online. Don’t be disappointed by an uncomfortable summer ever again with this MRCOOL ProDirect 3 Ton split system A/C condenser providing you comfort.",
