    "short_description": "ProDirect 4 Ton up to 15 SEER2 48,000BTU Split System Heat Pump",
    "long_description": "While getting a brand new home comfort unit can be extremely intimidating, taking your time and choosing the right system will definitely be worth it in the long run. There’s a big chance that the right system will be the MRCOOL ProDirect 4 Ton 15 SEER Split System Heat Pump Condenser, too. The scroll compressor works hard and fast to get the R-410A refrigerant ready to absorb discomfort from your home, and the piston flow control device helps improve your system’s efficiency. This unit is kept safe by the immaculate construction of the galvanized steel cabinet and the complete waterproofing of the Gold Fin® coil coating. Because the unit has this non-toxic, environmentally friendly, waterproof coating, there’s no way your unit is going to rust or corrode. The condenser is also ETL listed and AHRI certified, which assures its quality, and if you register it online, you can enjoy the benefits of enduring warranty protection and support. To get the most out of your time at home, install the ProDirect 4 ton split system heat pump condenser to bring yourself comfort and contentment.",
    "works_with": "",
    "feature_list": "<ul><li>Equipment should be installed by a qualified professional</li><li>10 Year Registered Warranty</li><li>15 SEER</li><li>R-410A environmentally friendly refrigerant</li><li>AHRI Certified &amp; ETL listed</li><li>Pressure and Temperature protection sensors help prevent damage</li><li>A shape coils, constructed with copper tubing and enhanced aluminum fins.</li><li>Gold Fin® condenser: corrosion resistant - live on the coast? Don&#39;t worry, our condenser is built to resist long term corrosion</li></ul>",
