    "short_description": "80% AFUE 3 Ton 70,000 BTU Downflow Multi-Speed Gas Furnace",
    "long_description": "When harsh winter weather strikes, nothing compares to the warmth and safety a powerful reliable gas furnace can provide. While furnace heating technology has been around for decades, not all systems are created equally. Some are definitely better than others. One of the best on the market is the MRCOOL single stage, 80% AFUE gas furnace. This system can be installed down flow, and is designed to operate for decades, provide powerful heating capability, and, best of all, keep your heating bill affordable at the same time. It does the latter via its 80% AFUE energy efficiency rating. That mark of quality ensures 80% of every dollar you spend on heating fuel gets turned into real, effective heat for your home.",
