    "short_description": "96% AFUE 4 Ton 70,000 BTU Downflow Multi-Speed Gas Furnace",
    "long_description": "Not only is the MRCOOL® Signature Series Single-Stage 96% AFUE 70k BTU able to provide effective heating for your home in an easy to install downflow configuration, it is also quiet running and energy efficient. With a 96% AFUE, this unit will help you save on utility bills. This is thanks in part to the multi-speed high efficiency blower motor. You can also experience enhanced cooling SEER ratings when applied with properly matched cooling equipment. You can expect longterm operation thanks to the durable build and finish and an aluminized steel primary heat exchanger with crimped non-welded construction. The aluminized steel inshot burners and durable silicon nitride ignitor help ensure smooth ignition. You can expect quick whole-home heating with the single stage gas valve. Installation is easy with the unit’s compact 33 inch design with standardized widths for easy coil fit. It can be easily vented with PVC pipe and offers left or right utility connections. It is design certified for direct and non-direct vent applications, and you have the opportunity to transition to liquid propane with an optional LP kit. Maintenance is easy for your HVAC technician courtesy of the easily removable slide out blower design. This furnace is proudly backed by a lifetime heat exchanger warranty and 10 year parts warranty.",
