    "long_description": "The MRCOOL® Signature Series Single-Stage 96% AFUE 45k BTU is a quiet-running and energy efficient downflow furnace unit that provides superior heating performance in a compact design. Thanks to the multi-speed high efficiency blower motor, the furnace features a 96% AFUE, and offers enhanced cooling SEER ratings when applied with properly matched cooling equipment, so utility costs will be more affordable. The unit’s durable build and finish is credited to an aluminized steel primary heat exchanger with crimped non-welded construction. For smooth ignition, the furnace features aluminized steel inshot burners and a durable silicon nitride ignitor. The single stage gas valve delivers home heating quickly and effectively. Installation is easy thanks to the unit’s compact 33 inch design and its standardized widths for easy coil fit. It can be easily vented with PVC pipe and offers a left or right utility connection. It is design certified for direct and non-direct vent applications. There is also an optional LP kit for liquid propane conversion if needed. The easily removable slide out blower design makes maintenance a breeze for a professional HVAC technician as well. For peace of mind, MRCOOL® backs this product with a lifetime heat exchanger warranty in addition to a 10-year parts warranty.",
