    "short_description": "96% AFUE 4 Ton 90,000 BTU Downflow Multi-Speed Gas Furnace",
    "long_description": "The MRCOOL® Signature Series Single-Stage 96% AFUE 90k BTU downflow furnace is a quiet running unit that provides excellent heating performance while remaining energy efficient. With low NOx, a 96% AFUE, and a multi-speed high efficiency blower motor, this furnace will ensure savings on your utility costs. The unit is constructed with an aluminized steel primary heat exchanger that is crimped and non-welded, resulting in a durable build and finish. Ignition is smooth thanks to the aluminized steel inshot burners and long lasting silicon nitride ignitor. The single stage gas valve ensures heating is delivered quickly to your home. In order to ease the installation process, the unit offers left or right utility connections and is design certified for direct and non-direct vent applications. It can be easily vented with PVC pipe and features a compact 33 inch design with standardized widths for an easy coil fit. An optional LP kit is also available if needed. Your HVAC technician will appreciate the easily removable slide out blower design that makes maintenance even easier. This downflow furnace is backed by a lifetime warranty on the heat exchanger and a 10 year parts warranty.",
