    "long_description": "Providing both superior performance and energy efficiency, the MRCOOL® Signature Series Single-Stage 96% AFUE 110k BTU downflow furnace is quiet running and effectively heats your home quickly. The 96% AFUE is thanks in part to the multi-speed high efficiency blower motor which ensures lower electricity consumption and utility costs. You can also experience enhanced cooling SEER ratings when you apply the unit with properly matched cooling equipment. The aluminized steel primary heat exchanger with crimped non-welded construction ensures a durable build and finish thus lengthening the lifespan of the furnace. Operation is superb with aluminized steel inshot burners and a long lasting silicon nitride ignitor for a smoother ignition process. Heating is delivered quickly to your entire home courtesy of the single stage gas valve. In order to ease the installation process, the furnace features left or right utility connections and offers standardized widths for easy coil fit. It is design certified for direct and non-direct vent applications and is easily vented with PVC pipe. With a compact 33 inch design, your HVAC technician will appreciate the ease of moving and positioning the unit. An optional LP kit is also available if needed. Maintaining the furnace is much easier with an easily removable slide out blower design. This unit is backed by a lifetime heat exchanger warranty as well as a 10 year parts warranty.",
