    "short_description": "3 Ton BTU R-410A Downflow Cased Evaporator Coil",
    "long_description": "This is a brand new 3 ton, R-410A refrigerant, downflow cased Evaporator Coil. This efficient and durable coil is the solution for heat pumps and air conditioners for fast, flexible application. This Signature Series coil, when appropriately paired with a MRCOOL Signature Series condenser and gas furnace or modular blower, can achieve efficiency ratings of up to 16 SEER.",
    "works_with": "",
    "feature_list": "<ul><li>Interlocking door assemblies and snug line sealgrommets to minimize air leakage</li><li>All units UL Listed and AHRI Certified</li><li>One of the lowest water retention drain pans in the industry to minimize mold and mildew growth</li><li>Heavy-gauge steel constructed cabinet for optimal support of the furnace, no need for additional bracing or structure.</li><li>Foil-face insulation for easy cleaning</li><li>All drain pans are compatible with UV lights</li><li>Removable Cabinet panels for easy coil service</li><li>Superior service access to components, withtubing located at door split and foil-face insulation</li><li>10-Year Parts Limited Warranty</li><li>Aluminum tubing, hairpins, distributors and header tubes. Copper refrigerant connections for easy brazing to both liquid and suction lines.</li><li>Tubing located at door split for easy coil service or cleaning</li></ul>",
