    "short_description": "95% AFUE 3 Ton 45,000 BTU Multi-Position Multi-Speed Gas Furnace",
    "long_description": "There's nothing like your first high gas bill of the season to make you dread a long, cold winter. If that's the boat you're in, you need to make a change. You need to invest in a powerful, high quality, and energy efficient heater like the 95% AFUE multi-positional gas furnace by MRCOOL. Unlike a lot of other furnace models, the MRCOOL 95% AFUE furnace wastes a minimal amount of fuel. This ensures most of your dollar is spent wisely rather than wasted, and that in turn means you have to spend less of those dollars to keep your house warm all winter long. Depending on the severity of winter weather where you live, that might mean the difference between a few dozen dollars or a few hundred dollars. So don't dread winter. Instead, choose the efficient, versatile and high quality heat of the MRCOOL. It's also protected by a 20 year Heat Exchanger Warranty, and a 10-Year Registered Parts Warranty.",
    "works_with": "",
    "feature_list": "<ul><li>Multi-speed high efficiency (constant torque) blower motor</li><li>Self diagnostics saves last 10 fault codes regardless of power interruption</li><li>Standardized widths for easy coil fit</li><li>10 year registered parts warranty</li><li>20 year heat exchanger warranty</li><li>Aluminized steel inshot burners for smooth ignition</li><li>Complies with California&#39;s South Coast Air Quality</li><li>Optional LP kit</li><li>Easily removable slide out blower design</li><li>Constant torque motor produces consistent airflow and even temperatures</li><li>Uses up to 1/3 less energy than a fixed-speed blower</li><li>Left or right utility connections, removable floorbase for bottom return air, zero step horizontal conversion</li></ul>",
