    "short_description": "96% AFUE 3 Ton 70,000 BTU Multi-Position Multi-Speed Gas Furnace",
    "long_description": "The MRCOOL® Signature Series Single-Stage 96% AFUE 70k BTU gas furnace is the perfect option to experly warm your home no matter how harsh the weather conditions. This quiet running, energy efficient unit is designed to be used in an upflow or horizontal configuration and offers low NOx. With a 96% AFUE, this furnace will save on utility costs thanks to the multi-speed high efficiency blower motor. When matched with the proper cooling equipment, you can experience enhanced cooling SEER ratings as well. It features a durable build and finish with an aluminized steel primary heat exchanger with crimped non-welded construction. For optimal operation, the furnace offers aluminized steel inshot burners for a smooth ignition process and a durable silicon nitride ignitor. The single stage gas valve delivers heating to your home quickly. The 33 inch compact design, left or right utility connection, and zero step horizontal conversion make this furnace easy to install. It features standardized widths for easy coil fit and is design certified for direct and non-direct applications. It is easily vented with PVC pipe and features a removable floor base for bottom return air. The optional LP kit allows for an easy conversion to use liquid propane. For easy maintenance, the furnace has an easily removable slide-out blower. For peace of mind, MRCOOL® offers a 10-year parts warranty and a lifetime heat exchanger warranty on this furnace.",
