    "long_description": "The MRCOOL Gas and Electric Packaged Unit combines a high performance 14 SEER air conditioner with a powerful gas furnace to deliver the best air comfort possible in all weather conditions. Like all MRCOOL products, this hybrid system is competitively priced, suitable for residential or commercial installation, and will run smoothly for years to come. A Package Gas Electric Unit is a fully self-contained, combination gas heating/electric cooling unit designed for outdoor installation. All unit sizes have return and discharge openings for both horizontal and down flow configurations, and are factory shipped with all down flow duct openings covered. Units may be installed either on a rooftop or on a cement slab. In gas heating mode, this unit is designed for a minimum continuous return-air temperature and a maximum continuous return-air temperature.",
