    "short_description": "4 Ton BTU R-410A Upflow Cased Evaporator Coil",
    "long_description": "This is a brand new 4 ton, R-410A refrigerant, Upflow cased Evaporator Coil. This efficient and durable coil is the solution for heat pumps and air conditioners for fast, flexible application. This Signature Series coil, when appropriately paired with a MRCOOL Signature Series condenser and gas furnace or modular blower, can achieve efficiency ratings of up to 16 SEER.",
