    "short_description": "2.5 Ton BTU R-410A Upflow Cased Evaporator Coil",
    "long_description": "This is a brand new 2.5 ton, R-410A refrigerant, Upflow cased Evaporator Coil. This efficient and durable coil is the solution for heat pumps and air conditioners for fast, flexible application. This Signature Series coil, when appropriately paired with a MRCOOL Signature Series condenser and gas furnace or modular blower, can achieve efficiency ratings of up to 16 SEER.",
    "works_with": "",
    "feature_list": "<ul><li>Interlocking door assemblies and snug line sealgrommets to minimize air leakage</li><li>All units UL Listed and AHRI Certified</li><li>One of the lowest water retention drain pans in the industry to minimize mold and mildew growth</li><li>External cabinet mounted distributor body designed for easy changing of orifice sizes and fast TXV connections</li><li>Foil-face insulation for easy cleaning</li><li>All drain pans are compatible with UV lights</li><li>Two dual drain on front of coil for install flexibility of drain lines around furnace vent and utility connections.</li><li>Superior service access to components, withtubing located at door split and foil-face insulation</li><li>10-Year Parts Limited Warranty</li><li>Aluminum tubing, hairpins, distributors and header tubes. Copper refrigerant connections for easy brazing to both liquid and suction lines.</li><li>Tubing located at door split for easy coil service or cleaning</li><li>Tightly sealed, painted steel cabinet with wall to wall insulation to ensure &lt;2% air leakage</li></ul>",
