    "short_description": "MRCOOL® Natural Gas Tankless Water Heater",
    "long_description": "Unlike traditional water heaters, the MRCOOL® Natural Gas Tankless Water Heater provides neverending hot water to up to four bathrooms and multiple home appliances simultaneously. With a high volume and flow rate, this tankless heater is highly efficient while still being environmentally friendly. This compact and space-saving heater has a much longer lifespan thanks to the stainless steel, corrosion resistant engineering. This design has four times the corrosion resistance of copper and is lead free. One of the many high tech features of this unit is the electronic thermostatic PCB, which provides intelligent temperature control and gas flow that is automatically controlled. The EDM BLDC variable-speed fan provides stable combustion along with a smooth air flow transition. The combustion chamber is surrounded by water tubes making it a thermal insulator also. The environmentally-friendly premixed burner gives a reduction of NOx emissions, lowers the flame temperature, and reduces port-loading. You can experience the most comfortable shower experience thanks to the self-adapting temperature regulation. A large touch-screen display provides helpful information to you and your plumber about the heater’s operation. This unit must be installed by a professional and offers a 15-year heat exchanger warranty, a 5-year parts warranty, and a 5-year labor warranty. This MrCool® Natural Gas Tankless Water Heater will replace your old water heater and provide efficiency and effectiveness.",
    "works_with": "",
    "feature_list": "<ul><li>Meets SCAQMD Standards</li><li>UNSPSC: 52141700</li><li>Not mobile home compatible</li><li>Min Temp: 95 F / Max Temp: 140 F</li><li>Wattage: 150 W (+114 W when anti-freeze module is on)</li><li>Maximum Gallons per Minute: 8.45g/min</li><li>Flow Rate @ 35°F Rise (gallons/min): 11.12</li><li>Flow Rate @ 45°F Rise (gallons/min): 8.45</li><li>Flow Rate @ 55°F Rise (gallons/min): 6.8</li><li>Flow Rate @ 65°F Rise (gallons/min): 5.8</li><li>92% Uniform Energy Factor (UEF)</li><li>PSI: 7-140</li><li>Hot water outlet: NPT3/4in</li><li>Hot water outlet: NPT3/4in</li><li>Gas inlet: NPT3/4in</li><li>Freeze Protection: Yes</li><li>Heat Exchanger Weight: 24.03</li></ul>",
