    "country_of_origin": "",
    "short_description": "MRCOOL® Liquid Propane Tankless Water Heater",
    "long_description": "With the MRCOOL® Liquid Propane Tankless Water Heater, you can enjoy hot water much longer and consistently than usually experienced with traditional water heaters. This tankless water heater features a high volume and flow rate, high efficiency, and is capable of accommodating multiple home appliances and up to four bathrooms. This heater is space-saving and compact while being environmentally friendly as well. Advanced engineering was used to create the corrosion resistant stainless steel unit, which increases the lifespan of the heater. With four times the corrosion resistance of copper, this feature ensures you have clean water in and clean water out. The many high tech features that come with this heater include an electronic thermostatic PCB and an EDM BLDC variable-speed fan. Featuring an eco-friendly premixed burner, you can expect higher efficiency, a higher turn-down ratio, and safer anti-flashback burner. This also creates a reduction in NOx emissions. The smart self-adapting temperature regulation ensures a comfortable shower experience with accurate temperature regulation. The anti-freeze protection keeps the pipeline water higher than 40°F. The large touch screen display keeps you and your plumber informed about the heater’s operation during maintenance. This unit must be installed by a professional. Feel protected by the 15-year warranty on the heat exchanger, as well as a 5-year parts warranty and a 5-year labor warranty.",
    "works_with": "",
    "feature_list": "<ul><li>Meets SCAQMD Standards</li><li>UNSPSC: 52141700</li><li>Not mobile home compatible</li><li>Min Temp: 95 F / Max Temp: 140 F</li><li>Wattage: 150 W (+114 W when anti-freeze module is on)</li><li>Maximum Gallons per Minute: 8.45g/min</li><li>Flow Rate @ 35°F Rise (gallons/min): 11.12</li><li>Flow Rate @ 45°F Rise (gallons/min): 8.45</li><li>Flow Rate @ 55°F Rise (gallons/min): 6.8</li><li>Flow Rate @ 65°F Rise (gallons/min): 5.8</li><li>92% Uniform Energy Factor (UEF)</li><li>PSI: 7-140</li><li>Hot water outlet: NPT3/4in</li><li>Hot water outlet: NPT3/4in</li><li>Gas inlet: NPT3/4in</li><li>Freeze Protection: Yes</li><li>Heat Exchanger Weight: 24.03</li></ul>",
